import React from "react";
interface IProps {
  rotor: any;
  className: String;
}
export const Rotor: React.FC<IProps> = ({ rotor, className }) => {
  return (
    <tr>
      {rotor.inputRow.split("").map((character: string) => (
        <td className={`td ${className} forwardPassLightUp`}>{character}</td>
      ))}
    </tr>
  );
};
